        private void PerformParseFromFilenameTest(IGpsParser parser, string filepath, string expectedOutput, string mapName)
        {
            var track = parser.ParseTrack(filepath);
            PerformGenericTestEvaluation(track, expectedOutput, mapName);
        }

        private void PerformParseFromFilestream(IGpsParser parser, string filepath, string expectedOutput, string mapImgName)
        {
            Track track;
            using (var fs = new FileStream(filepath, FileMode.Open))
            {
                track = parser.ParseTrack(fs);
            }

            PerformGenericTestEvaluation(track, expectedOutput, mapImgName);
        }

        private void PerformParseFromByteArray(IGpsParser parser, string filepath, string expectedOutput, string mapImgName)
        {
            Track track;
            using (var fs = new FileStream(filepath, FileMode.Open))
            {
                var data = new byte[fs.Length];
                fs.Read(data, 0, data.Length);
                track = parser.ParseTrack(data);
            }

            PerformGenericTestEvaluation(track, expectedOutput, mapImgName);
        }

        private void PerformGenericTestEvaluation(Track track, string expectedOutput, string mapImgName)
        {
            GenerateMap(track, mapImgName);

            var result = CompareWithExpectedOutput(track, expectedOutput);
            Assert.AreEqual(true, result,
                "ParseTrack(...) - parsed result is not equal to expected one");
        }

        private static bool CompareWithExpectedOutput(Track track, string expectedOutput)
        {
            var builder = new StringBuilder();
            foreach (var gps in track.GPSPoints)
            {
                builder.Append($"{gps},");
            }
            var actualOutput = builder.ToString();
            return actualOutput.Equals(expectedOutput);
        }

        private void GenerateMap(Track track, string mapImgName)
        {
            using (var mapStream = MapImageIO.LoadImgToStream(TestPaths.MapImgPath))
            {
                using (var bitmapDrawer = new BitmapDrawer(mapStream))
                {
                    bitmapDrawer.DrawTrack(track);
                    using (var stream = bitmapDrawer.SaveBitmapToStream())
                    {
                        MapImageIO.SaveImgToFile(stream, TestPaths.OutputFolderPath, mapImgName);
                    }
                }
            }
        }


